import React from 'react';
import Logo from "../common/Logo";
import {StyledHeader} from "./styles";

function Header() {
  return (
    <>
      <StyledHeader>
        <Logo/>
        
        <div>

        </div>
      </StyledHeader>
    </>
  );
}

export default Header;
